import Home from './Home'
export default function App() {
  const [movies, setmovies] = useState([]);
  useEffect(() => {
    axios.get(`http://http://localhost/php/api/api.php`)
      .then(res => setmovies(res.data))
  }, []);

  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home movie={movies} />} />
      </Routes>
    </BrowserRouter>
  );
}
